import React from 'react';

const MenuBar = ({ onMenuClick }) => {
  return (
    <div className="menu-bar">
      <button onClick={() => onMenuClick('menu1')}>Menu 1</button>
      <button onClick={() => onMenuClick('menu2')}>Menu 2</button>
      <button onClick={() => onMenuClick('menu3')}>Menu 3</button>
    </div>
  );
};

export default MenuBar;
